text:
 @dias._6486  Dominar o jogo não é necessariamente , ter mais chutes ( no caso do Santos dos 30 chutes apenas 2 em direção ao gol ) ,  ou mais posse , não adianta ter mais posse e não saber o que fazer quando está com a bola , Não ter jogadas bem trabalhadas , variações de jogadas etc , não adianta chutar 30 vezes se apenas duas levam perigo 

O atlético teve menores números de posse e chute porém nunca foi dominado pelo Santos pelo contrário ele se propôs e se arriscou a fazer o Santos ter mais posse e chutes , fez parte da estratégia do treinador do Dragão 

Eu enxergo que o dragão dominou muito mais  o Santos , ao não permitir com que o Santos criasse chances claras de gol , e ao conseguir contra ataques rápidos para criar chances claras ( mesmo não executando bem as chances nos contra ataques q teve )

